import './App.css';
import Header from "./Header.js";
import Tickers from "./Tickers.js";

function App() {
  return (
    <div className="App">
      <div className="app_header">
        <Header />
      </div>
      <div className="app_body">
        <div className="app_container">
            <Tickers />
        </div>
      </div>
        <div className="app_ending" style={{paddingTop: 200}}>
            <text style={{color: "white", display: "flex"}}>Made by Anuj Vasil for Gatsby Labs</text>
        </div>
    </div>
  );
}

export default App;
